import { useZohoContext } from "../Context/ZohoContext";
const EditarContactoBrand = () => {
    const {contactos} = useZohoContext();
    const contactosBrand = contactos.filter(contacto => (contacto.Rol_Contacto.includes("Owner / Brand Decision Maker")));
    console.log(contactosBrand);



    return ( 
        <div>
            {contactosBrand.map(contacto =>(
                <div key={contactosBrand.Full_Name}>
                    <div class="form-check d-flex" id={contactosBrand.Full_Name}>
                        <input class="form-check-input" type="radio" name="flexRadioDefault" id="flexRadioDefault1"/>
                        <label class="form-check-label ms-2">
                            {contacto.Full_Name} - 
                            {contacto.Rol_Contacto.map(rol => (
                                <span key={rol}>
                                    {rol}
                                </span>
                            ))}
                        </label>
                    </div>
                    
                </div>
            ))}

        <table className="me-3">
            <thead>
                <tr>
                    <th>Contacto</th>
                    <th>Roles</th>
                </tr>
            </thead>
            <tbody>
                    { 
                    contactosBrand.map(user => (
                        <tr key={user.Email} className="mt-3">
                            <td>{user.First_Name} {user.Last_Name}</td>
                            <td>{user.Rol_Contacto}</td>
                            <td>
                                <button className="btn btn-outline-primary" >Editar</button>
                                <button className="btn btn-outline-danger mt-1 mb-1" >Eliminar</button>
                            </td>
                        </tr>
                    ))
                } 
                
            </tbody>
        </table>
        </div>
        
     );
}
 
export default EditarContactoBrand;
